import L from "leaflet";



export const IconLocation = L.icon({
    iconUrl:require('../assets/ubicacion.webp'),
    iconRetinaUrl:require('../assets/ubicacion.webp'),
    iconAnchor: null,
    shadowUrl:null,
    shadowSize:null,
    shadowAnchor:null,
    iconSize:[55,55],
    className:"Leaflet-venue-icon",


});
